import React from "react";
import cake from "../src/images/bg1.jpeg";
const Home = () => {
  return (
    <>
      <section id="hero" class=" hero_main_margin main_div">
        <div class="container-fluid">
          <div class="row">
            <div class="col-11 mx-auto">
              <div class="row">
                <div class="col--6 pt-5 pt-lg-0 ">
                  <h1 className="text-capitalize">made for you with love.</h1>
                  <p className="text-uppercase">100% Natural, Welcome.</p>
                  <div>
                    <div class=" main_btn">
                      <a href="#services" class=" btn btn-outline-primary ">
                        Check More
                      </a>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Home;
